import React from "react";
import Typed from "react-typed";
import Navbar from "./Navbar.jsx";
import video from "../../src/pictures-olive/gait.mp4"
import img2 from "../../src/pictures-olive/home-page-pic2.png";
import img3 from "../../src/pictures-olive/homepage-pic-3.png";
import img4 from "../../src/pictures-olive/homepage-pic4.png";
import ml from '../../src/pictures-olive/code.jpg'
import cam from '../../src/pictures-olive/cam.jpg'
import report from '../../src/pictures-olive/report.jpg'

import Newsletter from "./Newsletter";
import LogoSlider from "./LogoSlider";
import { useNavigate } from "react-router-dom";

function Main() {
  const navigate = useNavigate();

  const divStyle = {
    position: "relative", // Make the div relative
    // Add other CSS styles as needed
  };

  return (
    <div>
      <div className="w-full justify-items-center bg-black">
        <Navbar />

        <div
          className="w-full md:h-[500px] mx-auto  bg-black justify-center sm:h-[800px] "
          style={{
            textAlign: "center",
          }}
        >

<div className="relative w-full h-[650px]" style={divStyle}>
        <video
          autoPlay
          loop
          muted
          id="video"
          className="w-full h-full object-cover blur-video"
        >
          <source src={video} type="video/mp4" />
        </video>

        <div className="absolute top-0 left-0 w-full h-full">
          <div className="overlay"></div>
          <div className="content text-black text-center absolute inset-0 flex items-center justify-center">
            <div className="text-background bg-white bg-opacity-50 p-4">
              <h1 className="text-4xl font-bold ">
                 Gait Analysis Using Multiview Geometry
              </h1>
              <h2 className="text-2xl text-black background:white text-justify pt-10 mx-40">

"Optimize your movement with precision using our cutting-edge gait analysis technology. Uncover biomechanical insights for enhanced performance and injury prevention."
              </h2>
            </div>
          </div>
        </div>
      </div>
      <div className=" h-40 bg-black">

      </div>

        </div>

        <div className='w-full py-20 md:h-[940px] mx-auto justify-center sm:h-[800px] '>


<div className='text-left   justify-center mx-auto  grid md:grid-cols-2  py-20'>
        <h1 className='text-5xl text-white font-semibold pt-10 md:mx-40 'style={{fontFamily: 'Roboto '}}> Services</h1>

</div>

<div className='text-left  font-bold font-xl justify-center grid md:grid-cols-3  text-white'>

    <div className='w-[600px] mx-auto justify-centerflex-col mx-500 my-6 px-20 text-white'>
    <img src={ml} alt=''/>
    {/* <h1 className='py-6 text-xl'>Plant Maintenance services </h1> */}
     <button className=' font-medium texl-xl justify-left hover:scale-110 my-10 mx-5 p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black  'onClick={() => navigate("/PlantServices")}>Multi-Angle Analysis</button>
    </div>

    <div className='w-[600px] mx-auto justify-center flex-col mx-500 my-6 px-20'>
    <img  className=' 'src={cam} alt=''/>
    {/* <h1 className='py-6 text-xl'>Training Services</h1>
                <h3 className='py-2'>Our SAP Integration service seamlessly connects your SAP system with other applications to streamline processes and increase efficiency.</h3> */}
  <button className=' font-medium  justify-left hover:scale-110 pt-10 my-10 mx-5 p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black' onClick={() => navigate("/TrainingServices")}>Camera Perspectives</button>
    </div>


    <div className='w-[600px] mx-auto justify-center flex-col mx-500 my-6 px-20'>
    <img src={report} alt=''/>
            {/* <h1 className='py-6 text-xl'>IT and SAP Services</h1>
                <h3 className='py-2'>Our IT Solutions service offers comprehensive and reliable support for all your technology needs, ensuring optimal performance and security.</h3> */}
                <button className=' font-medium  justify-left hover:scale-110 pt-10 my-10 mx-5 p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black' onClick={() => navigate("/ITServices")}>Graphical Overview</button>
    </div>


    <div className=" w-full py-20 md:h-[940px] mx-auto justify-center sm:h-[800px] bg-">

    </div>


</div>
</div>




        {/* <Newsletter /> */}
      </div>
    </div>
  );
}

export default Main;
